INSERT INTO `patients` VALUES (6,'Антуаннетта','1990-05-09 12:00:00',5,'2020-04-29 11:48:37.146519','2020-06-29 09:07:11.830068','Гетерофобия','боится мусчин',3),(7,'Васисуалий','1994-05-03 00:00:00',5,'2020-05-03 07:38:34.828006','2020-05-15 13:14:38.724932','Диагноз: Вася он и есть Вася','',1),(8,'Даша','1999-06-09 00:00:00',5,'2020-05-03 07:40:03.858074','2020-05-20 14:09:24.502650','Диагноз: три рубля и наша','',9),(9,'Исидор Первый','1975-08-10 04:00:00',5,'2020-05-03 07:41:17.350587','2020-05-19 17:46:36.797754','Диагноз: Мания величия','',10),(10,'Анюта','1978-09-03 06:00:00',5,'2020-05-03 08:58:30.564898','2020-05-20 05:47:41.210110','Диагноз: еле жива','недостаток жизненных сил',9),(11,'Анюта','1970-09-03 04:00:00',5,'2020-05-03 15:48:29.897608','2020-05-21 12:53:10.261887','Диагноз: двусторонний ксерофтальм','анютины глазки болят',4),(12,'Мостовская Ирина Евгеньевна','1974-05-15 00:00:00',5,'2020-05-04 04:39:29.848030','2020-06-29 06:33:34.729554','Диагноз: Пустота Крови','головокружение, бессонница. Пульс пустой, язык пересмотреть',1),(13,'Дегтярев Вадим Анатольевич','1969-01-25 00:00:00',5,'2020-05-04 05:25:20.502041','2020-05-21 08:12:41.854862','Диагноз: артроз тазобедренных суставов','тазобедренные. Оба типа `коксартроз`, больше справа. От Сан Саныча',1),(14,'Торяник Янна Александровна','1976-11-11 12:30:00',5,'2020-05-04 08:10:36.507044','2020-05-27 15:46:33.502737','Диагноз: Неврастения. Психосомат. боли.','Пустота Крови, Пустота Ци Селезенки. `болит все`. Эпигастрий. Левая коленка. Нервы(сама знает)',1),(15,'Шилов Павел Владимирович','1985-10-03 10:45:00',5,'2020-05-05 10:47:30.335011','2020-05-21 12:53:45.048177','Диагноз: Цервикалгия справа. Птоз справа','боли в шее, ок. года. Родился в Тюменской области. Много и быстро говорит. Лечился без эффекта физио, массаж. Кстати - птоз справа `с рождения`, периодически слеза',1),(16,'Шпак Анастасия Игоревна','1984-01-30 03:00:00',5,'2020-05-05 13:23:56.139327','2020-05-20 14:10:31.031366','Диагноз: Вертеброгенная радикулопатия L5 справа.','Гипестезия L5 справа. Грыжа парамедианно 6.5мм с компрессией.\n',1),(17,'Александров Антон Александрович (отец)','1976-10-10 14:00:00',5,'2020-05-06 04:08:26.195860','2020-05-20 04:11:00.816496','Шейный миозит','кривошея',1),(18,'Александров Максим Антонович','2002-09-09 00:00:00',5,'2020-05-06 04:51:52.949526','2020-06-29 19:57:47.979705','Диагноз: Цервикалгия','больше всего беспокоит шея. Типа `протрузии`. Играет в футбол. Пульс поверхностный, язык красноват(пересмотреть)',1),(19,'Зайцев Сергей Васильевич','1960-07-23 03:00:00',5,'2020-05-07 13:26:18.619538','2020-05-19 14:08:07.100774','Вертеброгенная радикулопатия  L5 (?) справа','правосторонняя поясничная типо грыжа',4),(20,'Мирясова Мария Павловна','1937-02-26 23:06:00',5,'2020-05-08 09:31:06.072609','2020-06-30 16:51:43.781583','Диагноз:  Гипертоническая болезнь. Шейный остеохондроз','`давление до 200, пью каптоприл, как подымется`. Шея и левая рука немеют (`хондроз`. Левая голень немеет',1),(21,'Дегтярева Людмила Константиновна','1948-10-16 12:00:00',5,'2020-05-11 04:51:27.711703','2020-05-25 04:27:09.941190','Диагноз: Люмбалгия слева','Боли в пояснице слева. `Депрессия` (схоронила мужа и сына)',1),(22,'Волков Михаил Валерьевич','1976-02-25 17:00:00',5,'2020-05-12 12:06:59.200875','2020-05-22 05:01:47.497091','Диагноз: Депрессия','Три года депрессия. Тревожность. Спит плохо. Виктория Николавна чевось назначила, засыпать стал лучше.',1),(23,'Бовшик Татьяна Владимировна','1982-12-28 12:00:00',5,'2020-05-12 13:50:29.748961','2020-05-15 11:30:23.939177','Диагноз: Люмбалгия. Невропатия тройничного слева','Тройничный по 2 ветви слева с 1 мая, после 9го - полегчало (невролог назначила таблетки). Сейчас больше всего беспокоит поясница . Нервная работа (менеджер трансп. компании)',4),(24,'Гущина','1954-08-04 23:00:00',5,'2020-05-15 06:21:01.856245','2020-05-22 06:52:23.786071','Диагноз: диабет','ноги',1),(25,'Пупкин','1981-05-15 12:00:00',5,'2020-05-15 07:15:24.943575','2020-07-13 04:58:23.461036','Диагноз: тест он и есть тест','тест городов',4),(26,'Тест_2','1980-05-01 12:00:00',5,'2020-05-15 11:22:25.013496','2020-05-16 07:06:05.464007','Диагноз: тестируем','оттачиваем мастерство',5),(27,'Перевалова Елена Валерьевна','1976-11-11 13:30:00',5,'2020-05-20 04:57:34.463824','2020-05-20 04:57:34.463824','Головная боль напряженного типа.','Боли в затылке реже одного раза в неделю. Болит спина, больше шея и поясница, жалобы невнятные. ПМС - `нестабильная психиха`.',1),(28,'Зайцев Василий Николаевич','1954-09-09 06:00:00',5,'2020-05-21 09:35:46.941032','2020-05-21 09:36:54.874170','Артроз левого колена 3 степени','Левое колено. Артроз 3ей степени. Давление `прыгает`. Военный, служил 25 лет.  Инфаркт 2014г, шунтирование 2015г',1),(29,'Клейменова Анастасия Вадимовна','2000-04-21 22:00:00',5,'2020-05-21 10:00:02.623632','2020-05-22 06:32:47.506619','Головная боль напряженного типа','Головные боли ок. двух лет. После менингита, неизвестной породы. Болит вся голова. Язык - Пустота Ци. Пульс - слегка сырость и струна. Цикл 26-30 дней, ПСМ - всех ненавижу',1),(30,'Майсюкова Галина Леонидовна','1945-10-10 20:00:00',5,'2020-05-21 11:36:19.701599','2020-05-21 11:36:19.701599','Артроз коленных суставов двусторонний','Предположительно в  в 20:00 родилась.\nКолени по передней поверхности болят до лодыжек',1),(31,'Кирик Валентина Ивановна','1952-06-30 00:01:00',5,'2020-05-22 05:49:39.874667','2020-05-25 08:08:50.037653','Остеохондроз','Болит все. Спина-хондрз, грудь-хондроз )\nАстма на НПВС. Язык алый, налета нет. Пульс - два Застоя.\n',1),(32,'Скороход Лариса Николаевна','1968-08-20 08:45:00',5,'2020-05-25 05:00:48.914071','2020-05-25 05:09:45.981475','Артроз 2 степени. Наверное.','Оперирована спина L5-S1 в 2007. Болят колени-голеностопы, больше правое колено, по передней пов-ти. Технолог обувного производства, `все болезни ног от неправильной обуви`.',7),(33,'Асадова Махира','1990-05-26 12:00:00',5,'2020-05-26 10:32:56.319303','2020-05-26 10:33:31.409423','Нейропатия тройничного слева','Остаточные дела, больше правый глаз - слабость смыкания. Узнать время рождения!',1),(34,'Бирюкова Людмила Ивановна','1948-11-18 14:00:00',5,'2020-05-28 09:58:45.092569','2020-09-25 08:28:03.755728','Цервикалгия. Гипертония','шея болит, давление иногда до 160 Родилась `после обеда`, наверное, в 14:00\n',1),(35,'Лазеева Нина Васильевна','1940-05-10 00:01:00',5,'2020-05-28 10:28:52.376129','2020-05-28 10:28:52.376129','Периферическая полиневропатия','полиневропатии? Дисциркулят. энцефалопатия. Колении (СанСаныч говорит, на потом можно оставить) Пульс: Пустота Крови, язык: Пустота Инь Почек',1),(36,'Сычева Илира Шамилевна','1988-05-31 14:05:00',5,'2020-06-08 04:10:42.283407','2020-06-08 04:10:42.283407','','',1),(37,'Ситдикова Валия','1942-07-19 12:00:00',5,'2020-06-08 05:29:41.589934','2020-06-08 05:29:41.589934','Пустота Инь Почек, кровь?, Застой Ци Печени','в 2018 болела спина в первый раз, лечилась у корейца на Маяковского, хорошо было. `жег еще меня` )) Язык - Жар Желудка, пульс: струнноват, пустоват',1),(39,'Рыбин Геннадий Михайлович','1934-04-24 00:01:00',5,'2020-06-08 08:19:03.663277','2020-06-12 07:36:52.185171','артрит плечевых суставов двусторонний','болят плечи, типа от шеи. Язык - Жар Крови слегка, пересмотреть. Пульс - Застой Ци, аритмия',1),(40,'Гусева Надежда Тимофеевна','1955-03-21 00:01:00',5,'2020-06-08 08:21:01.382078','2020-06-12 08:37:57.195338','вертеброгенная левосторонняя радикулопатия L5-S1','острая боль',1),(41,'Землянская Вера Александровна','1960-09-07 00:01:00',5,'2020-06-11 12:35:13.623839','2020-06-11 12:55:49.322501','Невропатия тройничного нерва слева','Невропатия тройничного слева, ок. двух месяцев. Лет семь назад была такая же, но справа, лечил китаец иглами, маладец, помог. В этот раз сделала 6 сеансов на Доменщиков, 7ой не пошла )',1),(42,'Халдеева Мария Ивановна','1947-04-25 00:01:00',5,'2020-06-17 09:39:10.755617','2020-06-17 09:39:10.755617','Пустота Инь Почек. Застой Чи Печени','Пустота Инь Почек. Два Застоя.\nЯзык - Жар Желудка или Пустота Инь Почек\nБолят колени. Болит область левого тазобедренного. СанСаныч говорит, больше мышечные дела. АД иногда до 160, как попсихует. Сон плохой, поздно не засыпает, рано просыпается',1),(43,'Гришин Иван Павлович','1949-05-25 12:01:00',5,'2020-06-22 04:50:38.949670','2020-06-22 04:50:38.949670','Пустота Инь Почек, Застой Ци Печени','Бессонница 3 года после смерти жены. АД до 210/х. Язык Пустота Инь. Пульс струна, больше слева во всех точках',1),(44,'Яковлев Григорий Алексеевич','1964-12-10 12:01:00',5,'2020-06-22 05:48:22.476671','2020-06-22 05:48:22.476671','Вертеброгенные боли в грудном и поясничном','Правый локоть не разгибается(давно, травмы не было). Паравертебрально в  р-не левой лопатки болит давно. `Грыжи` в поясничном, носки трудно одевать. Пульс струна, язык типа Жар Желчного слегка, пересмотреть',1),(45,'Пестрецова Ольга Владимировна','1981-10-31 11:25:00',5,'2020-06-23 10:07:24.828081','2020-06-23 10:18:38.484902','Пустота Ян Почек, Полнота в Мочевом','болит между лопатками, в пояснице и левой ягодице, спит хорошо. Пульс Пустота Ян Почек, язык невнятно',1),(46,'Одинцова Галина Ивановна','1949-01-27 00:01:00',5,'2020-06-23 13:06:58.588016','2020-06-23 13:09:52.015500','Пустота Крови с Жаром. Пустота Ян Почек. Сырость','отеки рук и ног, метипред и метотрексан не принимает. Пульс слева почти нет, справа Застой в Почках(Сырость?)',1),(47,'я сам','1974-09-18 16:45:00',5,'2020-06-25 07:38:07.916409','2020-07-03 05:11:21.066186','','ТЕСТОВЫЙ ПАЦИК',1),(48,'Отец','1942-02-13 12:01:00',5,'2020-07-02 18:42:20.387951','2020-07-02 19:55:04.863740','','',10),(49,'Саша Зар','1956-04-16 12:01:00',5,'2020-07-03 05:14:01.341189','2020-07-03 05:14:01.341189','','',3),(50,'Швыдченко Нина Афанасьевна','1947-01-07 12:01:00',5,'2020-07-06 04:33:29.309272','2020-07-06 04:44:43.484096','Застой Чи Печени на фоне Пустоты Инь Почек','боли в пояснице, `ноги не ходят`, боли по задней поверхности ног. АД от 100 до 170, прыгает. Язык: белый налет, сам небольшой. Пульс: Два Застоя, Все Пустое',1),(51,'Яровикова Алефтина Николаевна','1952-04-17 17:30:00',5,'2020-07-06 05:32:08.169440','2020-07-06 05:33:22.029908','Цервикалгия левосторонняя','Оперировано правое плечо, через 1.5 года опять заболело. Сейчас ночью резко заболело левое плечо и шею не повернуть влево. Колени оба протезированы',1),(52,'Косачева Людмила Васильевна','1953-11-19 12:01:00',5,'2020-07-06 07:09:04.163964','2020-07-06 07:24:31.302264','Артроз примерно 2 ст.','Болит правое колено. Спит плохо. КОлено укалывали трижды, видимо, дипроспан. Не полегчало, даже вроде хуже. Пульс Пустота Крови, язык Пустота Крови и Ци, пересмотреть\n',1),(53,'Мишина Алевтина Павловна','1944-07-23 14:30:00',5,'2020-07-06 07:39:03.510569','2020-07-06 07:39:03.510569','Пустота Инь Почек и Печени, Пустота Крови.','Больше года приступы боли в лице слева, сейчас только плохо закрывается глаз (был герпес типа). Гипертония, бессонница. Язык Пустота Ци больше, Пульс Два Застоя',1),(54,'Егорова Галина Владимировна','1968-08-09 12:01:00',5,'2020-07-07 09:58:33.539441','2020-07-08 04:54:46.885831','Люмбаго\n','Болит поясница слева, в ягодицу отдает. Язык Пустота Инь, и проплешины у корня. Пульс Пустота Ци и Крови. Глюкоза до 11, на таблетках 7-8. ',1),(55,'Чернев Сергей Николаевич','1977-10-28 10:45:00',5,'2020-07-07 12:17:17.191687','2020-07-13 04:49:31.518902','Люмбаго','боли в пояснице, после физ. нагрузки, `строил дом`. Язык - Пустота Селезенки, слегка Сырость. Пульс Пустота Крови. Принимает Триплексан+Кардиомагнил `от давления`',1),(56,'Родченков Михаил Владимирович','1955-03-04 12:01:00',5,'2020-07-09 09:43:54.710359','2020-07-10 07:48:38.193436','Пустота Инь Почек','Диабет. Пустота Инь Почек и, возможно, Легких. Пульс Пустота Ци и Крови. Бессонница. Левый тазобедренный лечил у Саныча',1),(57,'Берязева Зоя Владимировна','1949-03-08 00:30:00',5,'2020-07-09 11:37:23.540145','2020-07-10 06:38:28.182412','Пустота Инь Почек','Болит правый тазобедренный и коленный. Лечилась у СанСаныча, сейчас лазер. Бессонница. Пульс Пустота Крови, язык пустота Инь, много белого налета',1),(58,'Чанчиков Александр Анатольевич','1959-01-27 12:01:00',5,'2020-07-10 04:49:13.130682','2020-07-13 04:10:09.967773','Застой Чи Печени','Два года назад был инсульт в лобной доле и инфаркт. Сейчас типа болит правый тазобедренный. Пульс струна, язык - Пустота Крови и Инь вообще',1),(59,'Кучербаева Айнагуль Жумабековна','1981-12-18 12:01:00',5,'2020-07-14 12:23:43.643210','2020-07-14 12:23:43.643210','Головная боль напряженного типа','головные боли в висках, по 3-4 дня. Нолипрел от давления, давление от 100 до 140. Хм. Цикл 21 день, сами месячные 3 дня. Пульс Пустота Крови, язык Пустота Ци больше. Засыпает плохо. Любит сладкое. ',1),(60,'Копылов Александр Николаевич','1959-01-19 04:00:00',5,'2020-07-14 13:28:54.889602','2020-08-20 14:13:56.158326','Люмбаго с ишиасом. ','примерно в 4 утра родился. Тремор рук несколько лет, проявляется с устатку. Курил, бросил только что. Нога правая: приволакивает. Лежал в больнице дважды с пневмонией, вот, только вылечил. Пульс сырой, пустота Крови. Язык невнятно',1),(61,'Гаврилова Клавдия Ивановна','1936-09-06 12:01:00',5,'2020-07-15 08:40:10.123895','2020-07-15 08:40:10.123895','Пустота Инь Почек прежде всего','Болит поясница. АД до 160, слух снижен. Пульс струна. Язык Жар Желчного',1),(62,'Каукина Мария Николаевна','1941-04-15 12:01:00',5,'2020-07-15 09:18:33.103140','2020-07-15 09:18:33.103140','Пустота Инь Почек, застой Чи Печени','Болит поясница, больше слева. АД до 170, пульс струна, язык Пустота Инь. Слышит не очень',1),(63,'Стыценко Николай Сергеевиич','1978-08-23 17:40:00',5,'2020-07-20 04:13:05.601610','2020-07-20 04:13:05.601610','Пустота Легких и Ян Почек','редкие скачки АД до 220/х, связывает с алкоглем и нервами. От Наты Сановны. Оперировано травмированное колено в марте 2020, что-то с менисками после игры в футбол. Пульс Пустота Ян и Пустота Легких, язык отпечатки, пересмотреть',1),(64,'Якшимбетова Рашида Кажикеевна','1954-04-01 08:00:00',5,'2020-07-21 10:05:32.291872','2020-07-21 10:05:32.291872','Пустота Инь Почек','двусторонний нефросклероз, говорит. 12 лет уже. фистулы стоят. Не ходят ноги за счет коленей. Желтая. пульс слева - струна и скребет. Справа не могу, фистулы. Язык - Тип Пустота Инь слегка, хм.',1),(65,'Вишневская Валентина Пантелеевна','1951-05-08 12:01:00',5,'2020-07-21 11:50:23.608210','2020-07-21 11:50:23.608210','Застой Крови','Болит меж лопаток не менее недели, делала капельницы, экг не сделано, при поворотах больнее. Еще болят суставы, но сейчас типа не болят. Лечилась когда-то в Челябинске иглами у корейца, хорошо помогло. Язык - Пустота Ци и Инь, Сырость. Пульс пустоват, пересмотреть',1),(66,'Каримова Анна Борисовна','1981-01-17 01:05:00',5,'2020-07-22 04:41:14.589748','2020-07-22 04:41:14.589748','вертеброгенные боли','оперирована спина, травмы где-то на Северах, левая нога, поясница, левая рука, жгучие боли. Врач-гинеколог. Пульс пустоват, язык - Пустота Ци . Принимает монофазы, цикл, естессно, 28 дней',1),(67,'Белоногова Анна','1986-02-25 12:01:00',5,'2020-07-22 05:03:49.003718','2020-07-22 05:03:49.003718','ГБН','головные боли, типа ГБН, пульс пустоват. Цикл 28 дней, месячные 3 дня. Болит спина, пока не понял, где.',1),(68,'Сосна Антонина Александровна','1938-07-15 12:01:00',5,'2020-07-22 07:33:27.666468','2020-07-22 07:33:27.666468','ГБН. Гипертония. Вертебральные дела','шум в голове, звенит, колокольчики, вода. Болит весь позвоночник. Ад на лозапе 140/100 с редкими кризами',1),(69,'Садуакасов Богдат Козыканович','1962-11-13 12:01:00',5,'2020-07-23 12:35:07.213677','2020-08-20 12:45:27.211364','Невралгия тройничного 1 ветвь слева','невралгия 1 ветви тройничного слева, зимой обостряется\nпульс Застой Печени',1),(70,'Давлеткиреева Гузель Рашидовна','1980-06-11 12:01:00',5,'2020-07-27 08:10:59.503614','2020-07-27 08:10:59.503614','Вертеброгенная радикулопатия C7 слева','немеют пальцы левой руки. Лечится у невролога 6 дней',1),(71,'Филиппова Валентина Максимовна','1958-07-27 12:01:00',5,'2020-07-29 04:50:06.732658','2020-08-17 04:58:57.296219','Гипертония','Гипертония 150-60 с кризами до 220. Пульс интересный - как эмоционирует - сразу струя скребучая в Селезенке и Печени. Так - пустоват, струнноват. Язык - кончик красный, Пустота Крови',1),(72,'Кабиров Марат Касимович','1941-02-10 12:01:00',5,'2020-07-31 04:32:13.591982','2020-11-06 06:01:17.133265','Запор спастический. Пустота Инь Почек и Застой Чи Печени','ноги значительно лучше. Спина побаливает. Запор замучил',1),(73,'Варлакова Наталья Ивановна','1967-11-11 12:01:00',5,'2020-07-31 06:48:50.775855','2020-08-18 10:12:18.084232','Вертеброгенные дела.','Болит позвоночник, и там и там и тут, и правый локоть (мед. надмыщелок), больше сейчас в пояснице. Пустота Крови(Пульс). Лечилась блокадой в Ебурге три года назад, год не болело. Щас таблетки-уколы-физио (?)',1),(74,'Косенкова Ирина Александровна','1983-06-29 12:01:00',5,'2020-08-03 05:15:25.842995','2020-08-18 09:57:52.227415','гипестезия корковая','автоавария, правая нога сниж. чувствительность, я так понял. От СанСаныча. Пульс слегка сырость, язык Пустота Ци и красные точки. После еды сонливость. Месячные обильные, 7 дней, цикл 28. Мерзлячка.',1),(75,'Дубель Ирина Евгеньевна','1989-06-16 16:00:00',5,'2020-08-03 06:18:04.900195','2020-10-21 06:39:37.381754','','',1),(76,'Солодкова Маргарита Григорьевна','1946-09-28 12:01:00',5,'2020-08-04 12:26:35.843858','2020-08-05 06:29:07.542892','Люмбаго','Болит поясница минимум полгода. Саныч сказал - сначала к Толичу. Пульс Пустота Крови, язык невнятно',1),(77,'Байхаидзе Инна Викторовна','1976-01-07 17:30:00',5,'2020-08-06 14:36:58.558246','2020-09-22 17:17:25.038437','Пустота Инь Почек','болит спина, с месяц `так`. Раньше так не болела. Поясница.\nПульс Пустота Крови, язык - Жар Крови, Пустота Инь ',1),(78,'Амельченко Константин Алексеевич','1954-09-27 12:01:00',5,'2020-08-07 08:10:34.817502','2020-08-27 08:50:59.429295','Застой Чи Печени','СанСаныч по поводу хрустящей шеи и звона в ушах отправил ко мне. Лечился иглами у Мазура, что ли. И мануалил он же. Давно и эффективно. Пульс Застой Чи Печени. Язык трещина вдоль несильная',1),(79,'Кистер Юлия Владимировна','1975-11-28 07:15:00',5,'2020-08-10 05:53:21.045335','2020-11-06 08:24:49.014958','цервикалгия ','шея болит. Есть не хотелось после сеанса. Обычно и два раза могу поесть',1),(80,'Пасичник Алексей Леонидович','1976-02-14 23:00:00',5,'2020-08-10 06:04:24.262054','2020-08-26 04:26:56.512912','Пустота Крови, в т. ч. Печени, ян?','Шею свело с полгода назад. После тяж. работы. Пульс струна и пустой, язык дрожит, трещина посередке',1),(81,'Колесникова Ксения Анатольевна','1981-07-13 17:20:00',5,'2020-08-11 09:14:44.889621','2020-08-21 08:20:40.661127','Пустота Крови. Инь цзяо май?','Болят стопы, два года. Прошла все. Пульс Пустота Крови. Язык Пустота Ци и Крови и Жар Крови. месячные 25 дней, крови мало.',1),(82,'Глушков Дмитрий Владимирович','1965-08-30 12:01:00',5,'2020-08-11 13:13:22.426290','2020-08-11 13:13:22.426290','Пустота Инь Почек','то один сустав заболит, то другой. Сейчас больше всего в левой стопе мелкий, и правая кисть. Язык Пустота Инь, не укрывается ночью. Пульс Пустота Почек и Крови',1),(83,'Хамитова Каролина Сергеевна','1988-06-15 12:01:00',5,'2020-08-12 04:16:42.220723','2020-09-28 04:47:14.940683','Пустота Крови и Почек','одно ЭКО было, толку ноль. Готовка ко второму. Витилиго. Пульс Пустота Крови и Почек. Язык не разобрал, вроде Пустота Инь. Цикл 28-29, сами - 5, крови норм. Хм.',1),(84,'Ленивина Светлана Григорьевна','1953-05-08 12:01:00',5,'2020-08-12 05:18:08.581654','2020-09-24 11:03:13.883192','Пустота Почек','Диабет-2 ок. 10 лет. Пустой огонь Сердца на лице. Пульс Пустота Почек и Крови. БОлит поясница и правая больше нога, отдает в пах.',1),(85,'Витушкина Эмма Викторовна','1973-03-17 12:01:00',5,'2020-08-12 10:24:34.309693','2020-10-06 11:21:33.853553','Пустота Инь Почек и Крови','болит средний палец левой руки. Пульс Пустота Инь, Крови. Язык Пустота Инь \r\