0-09-15 10:44:05.759326','2020-10-09 08:18:26.676994','Пустота Инь Почек. Застой Чи Печени','левая нога под коленом болит, три месяца. Невролог. Нет эффекта. Пульс струнноват, Пустота Легких. Язык Пустота Инь слегка, может, Жар Желудка',1),(117,'Панкратова Людмила Николаевна','1950-03-08 12:01:00',5,'2020-09-17 10:48:23.875648','2020-10-07 07:13:00.736700','Пустота Инь Почек, Печени. Жар Сердца','тик левого глаза ок. 20 лет. Головные боли(затылок,темя), АД до 160, амлодипин вечером. Пульс струна, язык Пустота Инь. Астма. Принимает амлодипин и кораксан(антиангин.)',1),(118,'Тропина Вера Семеновна','1949-03-05 12:01:00',5,'2020-09-21 06:52:50.282852','2020-10-05 05:46:22.993372','Пустота Инь Почек(Печени?)','шум в голове, АД нестабильно(110-190). Пульс пустоват, струнноват, язык типа Пустота Инь, но с белым налетом',1),(119,'Зайцева Анна Игоревна','1990-08-19 07:00:00',5,'2020-09-21 07:49:51.628923','2020-09-21 07:59:28.487455','Жар Желчного. Пустота Крови','гестационная гипертония и сах. диабет. Ща типа лучше. Курит \"от нефиг делать\". Склонна к приступам гнева. Язык Жар Желчного и Легких, пульс Пустота Крови и/или Ци',1),(120,'Лена Владимировна','1979-09-12 12:00:00',5,'2020-09-23 15:15:27.651905','2020-09-23 15:15:27.651905','','',7),(121,'Шарыгина Валентина Геннадьевна','1956-12-23 12:01:00',5,'2020-09-28 07:39:31.147296','2020-10-02 07:26:20.857107','Пустота Инь Почек. Застой Чи Печени','у меня панкреатит. Лечили в 2016 иглами в Челябе, 4 года ремиссия. Делали все в живот. Хм. Пульс Два Застоя. АД было 140 в момент осмотра. Язык две залысины в Почках, белый налет. Любит пить холодную воду.',1),(122,'Дроботова Валентина Андреевна','1967-08-24 12:01:00',5,'2020-09-29 11:12:26.494688','2020-10-20 11:50:41.552645','Застой Чи Печени. Жар Крови?','немеют руки, ок. трех месяцев, обострились 2 нед. назад, начало совпало с менопаузой. Пульс струна, ок.90уд/мин, язык - Жар Крови, больше в обл. Почек',1),(123,'Черкасова Эльвира Адиповна','1980-04-06 12:01:00',5,'2020-10-01 11:32:42.982959','2020-10-16 04:10:57.053819','Пустота Крови','пьет дюфастон. Депо-провера(противозач.) много лет пила. Болит шея(кругом хондроз), и левая нога \"от позвонка\". Пульс Пустота Крови, струна. Язык Пустота Ци, м. б. Жар Желчного',1),(124,'Дроботов Михаил Сергеевич','1987-02-08 23:00:00',5,'2020-10-07 04:59:30.532124','2020-10-20 11:08:29.231277','Пустота Инь Почек и Крови','болит спина в одной точке справа, ок. года, три дня сильнее. Пульс струна, язык пустота Инь и Крови',1),(125,'Чернякова тамара Петровна','1947-06-20 12:01:00',5,'2020-10-08 13:41:24.300540','2020-10-12 09:18:04.741606','травма правого седалищного нерва ','типа травма нерва (седалищного субпоплитеально?) правой ноги. На фоне микроинсульта под вопросом и паркинсона под вопросом. Тонус правой руки больше левой. Язык Жар Желудка. Пульс Пустота Почек',1),(128,'Фролочкина Ольга Николаевна','1976-08-17 12:01:00',5,'2020-10-13 09:20:29.831709','2020-10-15 11:24:01.303708','','',1),(129,'Скворцова Татьяна Леонидовна','1971-06-04 08:00:00',5,'2020-10-13 09:45:14.725780','2020-11-06 08:36:58.999350','Пустой Жар. Люмбоишиалгия. ГБН','ГБН. Поясница и левая нога по задн. пов-ти. Пульс Застой Чи Печени, Пустота Почек и меньше Перикарда, Пустота Легких. язык Жар Сердца. Месяц лезли волосы. Месячные раз в три дня, сами - обильные',1),(130,'Рожков Виктор Леонидович','1955-10-28 12:01:00',5,'2020-10-13 10:32:53.324720','2020-10-20 10:46:56.118210','Застой Чи Печени.','Левое плечо и правое колено, больше по ночам. Лысый. Пульс струна. Язык невнятно, больше Застой Крови. СанСаныч 8 из 10 убрал проблему, дальше нет прогресса.',1),(131,'Пономарева Татьяна Сергеевна','1982-11-08 07:30:00',5,'2020-10-14 06:16:14.451463','2020-10-21 09:21:15.989584','Пустота Инь Почек. Пустота Крови. Пустота Перикарда','боли под лопаткой слева ок. двух лет, связывает с нэрвами. МЦ 26, каждый раз по-разному крови, сами 5 дней, еда, раздражительность. \"поликистоз, мужского гормона было много\", пила дюфастон и контрацептивы. Пульс струна, пустота Перикарда.  Язык Пустота Крови и Инь Почек. МЦ 6 день',1),(132,'Зайцев Александр Владимирович','1988-04-28 10:00:00',5,'2020-10-16 07:01:36.201855','2020-11-04 05:16:13.611620','Жар Крови. Застой Ци Печени','ГБН. Пульс струнноват, Язык Жар Крови, лысины на языке и не на нем, соски красные',1),(133,'Миллер Юлия Юрьевна','1992-09-18 03:00:00',5,'2020-10-26 20:23:59.759988','2020-11-02 10:28:24.972028','','в карте один металл',12),(134,'Барна Валерий Васильевич','1968-11-28 04:00:00',5,'2020-11-03 09:47:35.939917','2020-11-06 07:19:36.953074','Пустота Инь Почек. ','после ДТП, правая нога и правое плечо. Пульс Пустота Почки слева, язык невнятно. Плохо засыпает, часто просыпается. ',1),(135,'Швыдченко Евгений Николаевич','1973-03-07 06:45:00',5,'2020-11-03 11:00:25.135760','2020-11-05 11:11:11.198449','Пустота Селезенки(язык), Пустота Крови(пульс слева)','спина с иррадиацией в правую ногу, лечился в прошлом году у меня, сейчас - после прыга с небольшой высоты. Немного ВТЭСа и УВТ. ',1),(136,'Файзуллин Рафкат Зинатович','1935-02-12 12:01:00',5,'2020-11-03 11:29:05.279501','2020-11-06 06:34:44.698699','Застой Чи Печени, Сырость. ','от СанСаныча. Был лейкоз. Ремиссия. Колени+голеностопы - трудно гнутся. Как, впрочем, и лучезапястные. Язык - Пустота Крови Печени, и вроде Жар Желудка. \r\nПульс струна и сырость. ',1),(137,'Волоснова Елена Алексеевна','1972-04-02 01:00:00',5,'2020-11-04 06:32:58.588446','2020-11-06 07:30:56.919574','Пустота Крови','опухают к утру кисти, после трех часов дом. работы \"расхаживаются\". Пульс Пустота Сердца. Цикл - после курантила (!) - появился. Пмс-а нет. Сами 7 дней. МЦ=3, сам цикл 28. Имеется бесплодие (?)\r\nЯзык короткая трещина осередь',2),(138,'Асауф Гульнара Султановна','1971-03-04 12:01:00',5,'2020-11-05 11:39:59.177346','2020-11-06 05:44:26.864164','Пустота Ци Селезенки? Жар Крови','левое колено по внутр поверхности, не меньше месяца, не первый раз уже. Язык Жар Крови(Желудка?) Пульс струнноват',1);
